import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class CheckFormService {

  constructor() { }

  checkName(name:string): boolean{
    if(name ==undefined){
      return false
    }
    else{
      return true
    }
  }
  checkDescription(description:string): boolean{
    if(description ==undefined){
      return false
    }
    else{
      return true
    }
  }
}
